import React from 'react';
import ChristianDrinking from '../images/team/ChristianDrinking.jpg';
import HeaderSection from './components/HeaderSection';
import Team from './components/Team';
import Beer from './components/beer';
import Platforms from './components/Platforms';
import Anchor from '../images/platforms/anchor.jpg';

const Home = () => {
  const rowStyle = {
    position: "absolute",
    transform: "translate(-50%, -50%)",
    left: '50%',
    top: '50%',
    boxShadow: "0 0 1rem #fff",
    zIndex: "-1"
  }

  return (
    <>
    <div className="container-fluid home-context">
    <div className="row align-items-center">
    <div className="col align-self-center">
      <h1 class="display-4 font-weight-normal">Beers & Brewskies</h1>
      <p class="lead font-weight-normal">Created by the men, for the boys.</p>
      <button className="btn btn-secondary">View</button>
    </div>
    </div>
    </div>
    </>
  )
}

export default Home;
